import{_ as A,o as a,c as t,b as r}from"./app.e24ddfb2.js";const o={},V=r('<h1 id="huong-dan-hoc-photoshop-cs6-co-ban" tabindex="-1"><a class="header-anchor" href="#huong-dan-hoc-photoshop-cs6-co-ban" aria-hidden="true">#</a> H\u01B0\u1EDBng d\u1EABn h\u1ECDc Photoshop cs6 c\u01A1 b\u1EA3n</h1><h2 id="b-huong-dan-hoc-photoshop-cs6-co-ban" tabindex="-1"><a class="header-anchor" href="#b-huong-dan-hoc-photoshop-cs6-co-ban" aria-hidden="true">#</a> <strong><strong>B. H\u01B0\u1EDBng d\u1EABn h\u1ECDc Photoshop cs6 c\u01A1 b\u1EA3n</strong></strong></h2><p>Trong m\u1EE5c n\xE0y, ch\xFAng m\xECnh s\u1EBD cung c\u1EA5p c\xE1c h\u01B0\u1EDBng d\u1EABn Photoshop cs6 (c\xE1c tutorials h\u1ECDc Photoshop c\u01A1 b\u1EA3n).</p><h3 id="bai-01-05-cong-cu-co-ban-nhat-khi-hoc-photoshop" tabindex="-1"><a class="header-anchor" href="#bai-01-05-cong-cu-co-ban-nhat-khi-hoc-photoshop" aria-hidden="true">#</a> <strong><strong>B\xE0i 01: 05 c\xF4ng c\u1EE5 c\u01A1 b\u1EA3n nh\u1EA5t khi h\u1ECDc Photoshop</strong></strong></h3><p><img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1563370733HAnNnfGWcCRube0.jpg"></p><p>- Layers</p><p>- Selection Tool</p><p>- <a href="https://colorme.vn/blog/huong-dan-05-cong-cu-co-ban-nhat-cua-photoshop-54690" target="_blank" rel="noopener noreferrer"><strong>C\xE1ch s\u1EED d\u1EE5ng quick selection tool trong Photoshop</strong></a></p><p>- \u0110i\u1EC1u ch\u1EC9nh ch\u1EA5t l\u01B0\u1EE3ng \u1EA3nh</p><p>- Blending Mode</p><p>- \u0110\u1EA3o v\xF9ng ch\u1ECDn trong Photoshop</p><p>&gt;&gt; \u0110\u1ECDc th\xEAm: <a href="https://colorme.vn/blog/huong-dan-05-cong-cu-co-ban-nhat-cua-photoshop" target="_blank" rel="noopener noreferrer"><strong>H\u1ECDc Photoshop c\u01A1 b\u1EA3n v\u1EDBi 05 c\xF4ng c\u1EE5 n\xE0y</strong></a></p><h3 id="bai-02" tabindex="-1"><a class="header-anchor" href="#bai-02" aria-hidden="true">#</a> <strong><strong>B\xE0i 02</strong></strong>:</h3><p>C\xE1c c\xF4ng c\u1EE5 n\xE2ng cao h\u01A1n khi h\u1ECDc Photoshop nh\u01B0: Layer mask; Clipping mask; Pen tool. B\xE0i vi\u1EBFt d\u01B0\u1EDBi \u0111\xE2y s\u1EBD h\u01B0\u1EDBng d\u1EABn b\u1EA1n c\xE1ch s\u1EED d\u1EE5ng pentool trong Photoshop cs6 c\xF9ng v\u1EDBi clipping mask hay layer mask. \u0110\u1EB7c bi\u1EC7t, c\xE1ch s\u1EED d\u1EE5ng pentool trong Photoshop cs6 \u0111\u01B0\u1EE3c \u1EE9ng d\u1EE5ng \u0111\u1EC3 v\u1EBD \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop ho\u1EB7c \u0111\u01B0\u1EDDng cong trong Photoshop cs6 (h\u01B0\u1EDBng d\u1EABn trong b\xE0i 4 d\u01B0\u1EDBi \u0111\xE2y)</p><p>&gt;&gt; \u0110\u1ECDc th\xEAm: <a href="https://colorme.vn/blog/7-luu-y-cho-nguoi-moi-bat-dau-hoc-photoshop-51536.51536" target="_blank" rel="noopener noreferrer"><strong>H\u1ECDc Photoshop cs6</strong></a></p><p><img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1563371040nwYWVo0Cp6VCmbA.jpg">M\u1ED9t th\xE0nh qu\u1EA3 khi s\u1EED d\u1EE5ng clipping mask trong Photoshop</p><h3 id="bai-03-nen-thiet-ke" tabindex="-1"><a class="header-anchor" href="#bai-03-nen-thiet-ke" aria-hidden="true">#</a> <strong><strong>B\xE0i 03: N\u1EC1n thi\u1EBFt k\u1EBF</strong></strong></h3><p>Kh\xE1 nhi\u1EC1u thi\u1EBFt k\u1EBF Photoshop s\u1EED d\u1EE5ng ch\xEDnh c\xE1c h\xECnh \u1EA3nh l\xE0m n\u1EC1n. Nh\u01B0ng, \u0111a s\u1ED1 g\u1EB7p v\u1EA5n \u0111\u1EC1 v\u1EC1 vi\u1EC7c c\xE1c layer tr\xF4ng r\u1ED1i m\u1EAFt, ho\u1EB7c b\u1ED1 c\u1EE5c kh\xF4ng h\xE0i ho\xE0. V\xE0 \u0111\xE2y l\xE0 04 c\xE1ch s\u1EED d\u1EE5ng h\xECnh \u1EA3nh l\xE0m n\u1EC1n trong thi\u1EBFt k\u1EBF hi\u1EC7u qu\u1EA3 cho b\u1EA1n:</p><p>- S\u1EED d\u1EE5ng kho\u1EA3ng tr\u1ED1ng: H\xE3y s\u1EED d\u1EE5ng h\xECnh \u1EA3nh theo c\xE1ch b\u1EA1n mu\u1ED1n, di chuy\u1EC3n sang xung quanh, crop c\xE1c g\xF3c kh\xE1c nhau \u0111\u1EC3 c\xF3 th\u1EC3 t\u1EA1o ra \u0111\u01B0\u1EE3c m\u1ED9t v\xF9ng tr\u1ED1ng \u0111\u1EC3 ch\xE8n \u0111\u1ED1i t\u01B0\u1EE3ng th\xF4ng tin l\xEAn</p><p>- L\xE0m nho\xE8 h\xECnh \u1EA3nh: Vi\u1EC7c l\xE0m nho\xE8 \u1EA3nh gi\xFAp ph\u1EA7n ch\u1EEF (typography) c\u1EE7a b\u1EA1n tr\u1EDF n\xEAn n\u1ED5i b\u1EADt v\xE0 r\xF5 r\xE0ng h\u01A1n. B\u1EA1n c\xF3 th\u1EC3 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Blur.</p><p>- Thay \u0111\u1ED5i \u0111\u1ED9 trong c\u1EE7a \u1EA3nh</p><p>T\xE1c d\u1EE5ng \u0111\u1EA7u ti\xEAn c\u1EE7a c\u1EE7a vi\u1EC7c l\xE0 t\u0103ng \u0111\u1ED9 trong c\u1EE7a \u1EA3nh l\xE0 t\u1EA1o kho\u1EA3ng tr\u1ED1ng \u1EA3o, \u0111\u1ED3ng th\u1EDDi l\xE0m t\u0103ng s\u1EF1 t\u01B0\u01A1ng ph\u1EA3n \u0111\u1EC3 ph\u1EA7n ch\u1EEF th\xF4ng tin c\u1EE7a b\u1EA1n tr\u1EDF n\xEAn n\u1ED5i b\u1EADt. B\u1EA1n c\xF3 th\u1EC3 t\u1EA1o l\u1EDBp n\u1EC1n b\u1EB1ng c\xE1ch k\u1EBFt h\u1EE3p c\xE1c l\u1EDBp g\u1ED3m 1 h\xECnh kh\u1ED1i m\xE0u r\u1EF1c r\u1EE1 v\u1EDBi m\u1ED9t b\u1EE9c \u1EA3nh trong, gam m\xE0u trung t\xEDnh.</p><p>- T\u1ED1i \u01B0u ch\u1ED3ng l\u1EDBp :</p><p>M\u1ED9t b\u1EE9c \u1EA3nh n\u1EC1n s\u1EB7c s\u1EE1 c\xF3 th\u1EC3 t\u1EA1o s\u1EF1 ch\xFA \xFD. Nh\u01B0ng c\u0169ng khi\u1EBFn cho ph\u1EA7n text c\u1EE7a b\u1EE9c \u1EA3nh g\xE2y r\u1ED1i m\u1EAFt. \u0110\u1EC3 kh\u1EAFc ph\u1EE5c \u0111i\u1EC1u n\xE0y, b\u1EA1n c\u1EA7n c\xF3 m\u1ED9t layer h\xECnh kh\u1ED1i n\u1EB1m gi\u1EEFa ph\u1EA7n text v\xE0 n\u1EC1n \u0111\u1EC3 t\u1EA1o s\u1EF1 r\xF5 r\xE0ng.</p><h3 id="bai-04-ve-\u0111uong-thang-trong-photoshop" tabindex="-1"><a class="header-anchor" href="#bai-04-ve-\u0111uong-thang-trong-photoshop" aria-hidden="true">#</a> <strong><strong>B\xE0i 04: V\u1EBD \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop</strong></strong></h3><p>Trong qu\xE1 tr\xECnh h\u1ECDc Photoshop, b\u1EA1n mu\u1ED1n v\u1EBD \u0111\u01B0\u1EDDng c\u01A1 b\u1EA3n trong Photoshop m\u1ED9t c\xE1ch ch\xEDnh x\xE1c ? V\u1EADy th\xEC h\xE3y tham kh\u1EA3o c\xE1c b\u01B0\u1EDBc v\u1EBD \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop v\xE0 \u0111\u01B0\u1EDDng cong d\u01B0\u1EDBi \u0111\xE2y:</p><p>C\xE1ch v\u1EBD \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop:</p><p>B\u01B0\u1EDBc 1: T\u1EA1o Layer m\u1EDBi trong Photoshop</p><p>Nh\u1EA5n t\u1ED5 h\u1EE3p 3 ph\xEDm Ctrl + Shift + N.</p><p>B\u01B0\u1EDBc 2: Ch\u1ECDn c\xF4ng c\u1EE5 Line Tool.</p><p>B\u01B0\u1EDBc 3: Thi\u1EBFt l\u1EADp line v\u1EBD</p><p>Ch\u1ECDn m\xE0u vi\u1EC1n, k\xEDch c\u1EE1 v\xE0 \u0111\u1ECBnh d\u1EA1ng c\u1EE7a \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop.</p><p>B\u01B0\u1EDBc 4: V\u1EBD \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop</p><p>K\xE9o chu\u1ED9t t\u1EEB \u0111i\u1EC3m b\u1EAFt \u0111\u1EA7u \u0111\u1EBFn \u0111i\u1EC3m k\u1EBFt th\xFAc c\u1EE7a \u0111\u01B0\u1EDDng th\u1EB3ng c\u1EA7n v\u1EBD r\u1ED3i th\u1EA3 tay.</p><p>B\u01B0\u1EDBc 5: Di chuy\u1EC3n \u0111\u01B0\u1EDDng th\u1EB3ng</p><p>V\xE0o Layer v\u1EEBa t\u1EA1o r\u1ED3i ch\u1ECDn c\xF4ng c\u1EE5 Move Tool. D\xF9ng chu\u1ED9t di chuy\u1EC3n \u0111\u01B0\u1EDDng th\u1EB3ng \u0111\u1EBFn v\u1ECB tr\xED mong mu\u1ED1n.</p><h3 id="bai-5-cach-cat-ghep-anh-trong-photoshop-cs6" tabindex="-1"><a class="header-anchor" href="#bai-5-cach-cat-ghep-anh-trong-photoshop-cs6" aria-hidden="true">#</a> <strong><strong>B\xE0i 5: C\xE1ch c\u1EAFt gh\xE9p \u1EA3nh trong Photoshop cs6</strong></strong></h3><p>Khi h\u1ECDc Photoshop cs6, m\u1ED9t k\u0129 n\u0103ng Photoshop c\u01A1 b\u1EA3n l\xE0 c\u1EAFt v\xE0 c\xE1ch gh\xE9p \u1EA3nh. \u0110\u1EC3 gh\xE9p 2 \u1EA3nh trong Photoshop cs6 th\xE0nh th\u1EA1o, b\u1EA1n n\xEAn tham kh\u1EA3o c\xE1c b\u01B0\u1EDBc trong b\xE0i vi\u1EBFt d\u01B0\u1EDBi \u0111\xE2y:</p><p>&gt;&gt; \u0110\u1ECDc th\xEAm: <a href="https://colorme.vn/blog/8-buoc-don-gian-giup-ban-ghep-anh-trong-photoshop-cs6" target="_blank" rel="noopener noreferrer"><strong>C\xE1ch gh\xE9p \u1EA3nh trong Photoshop</strong></a></p><p>B\xE0i vi\u1EBFt tr\xEAn cung c\u1EA5p 8 b\u01B0\u1EDBc l\xE0m ho\xE0n h\u1EA3o \u0111\u1EC3 b\u1EA1n bi\u1EBFt c\xE1ch gh\xE9p \u1EA3nh trong Photoshop cs6.</p><h2 id="c-huong-dan-hoc-photoshop-cs6-nang-cao" tabindex="-1"><a class="header-anchor" href="#c-huong-dan-hoc-photoshop-cs6-nang-cao" aria-hidden="true">#</a> <strong><strong>C. H\u01B0\u1EDBng d\u1EABn h\u1ECDc Photoshop cs6 n\xE2ng cao</strong></strong></h2><p>Sau nh\u1EEFng n\u1EC1n t\u1EA3ng h\u1ECDc Photoshop c\u01A1 b\u1EA3n, b\u1EA1n c\xF3 th\u1EC3 \u2018\u0111\u1EE7 v\u0169 kh\xED\u2019 \u0111\u1EC3 tham kh\u1EA3o m\u1ED9t s\u1ED1 h\u01B0\u1EDBng d\u1EABn h\u1ECDc Photoshop n\xE2ng cao r\u1ED3i! C\xE1c h\u01B0\u1EDBng d\u1EABn Photoshop n\xE2ng cao s\u1EBD t\u1EADp trung v\xE0o c\xE1c xu h\u01B0\u1EDBng, phong c\xE1ch truy\u1EC1n c\u1EA3m h\u1EE9ng v\xE0 k\u0129 thu\u1EADt n\xE2ng cao h\u01A1n.</p><h3 id="_1-xu-huong" tabindex="-1"><a class="header-anchor" href="#_1-xu-huong" aria-hidden="true">#</a> <strong><strong>1. Xu h\u01B0\u1EDBng</strong></strong></h3><p>Xu h\u01B0\u1EDBng, \u0111\u1EB7c bi\u1EC7t l\xE0 xu h\u01B0\u1EDBng graphic design lu\xF4n thay \u0111\u1ED5i theo t\u1EEBng n\u0103m. Nh\u01B0ng c\u0169ng gi\u1ED1ng th\u1EDDi trang, xu h\u01B0\u1EDBng graphic design lu\xF4n l\xE0 v\xF2ng tr\xF2n l\u1EB7p v\u1EDBi m\u1ED9t s\u1ED1 c\u1EA3i ti\u1EBFn m\u1EDBi h\u1EE3p th\u1EDDi, h\u1EE3p nhu c\u1EA7u m\u1EDBi.</p><p>C\xF3 th\u1EC3 k\u1EC3 t\xEAn m\u1ED9t s\u1ED1 xu h\u01B0\u1EDBng thi\u1EBFt k\u1EBF \u0111\u1ED3 ho\u1EA1 nh\u01B0:</p><p>- Kh\xF4ng tr\u1ECDng l\u1EF1c: \u0110\xF3 l\xE0 khi c\xE1c elements trong thi\u1EBFt k\u1EBF Photoshop c\u1EE7a b\u1EA1n lu\xF4n t\u1EA1o c\u1EA3m gi\xE1c \u2018bay\u2019 cho ng\u01B0\u1EDDi nh\xECn.</p><p>- Hi\u1EC7u \u1EE9ng kim lo\u1EA1i: Hi\u1EC7u \u1EE9ng n\xE0y \u0111\u1EB7c bi\u1EC7t \u0111\u01B0\u1EE3c \u01B0a d\xF9ng trong thi\u1EBFt k\u1EBF 3D v\xE0 bao b\xEC th\u01B0\u01A1ng hi\u1EC7u, t\u1EA1o s\u1EF1 \u0111\u1ED9c \u0111\xE1o v\xE0 sang tr\u1ECDng, hi\u1EC7n \u0111\u1EA1i.</p><p>- Outline Typography:</p><p>Ngo\xE0i ra, c\xF2n m\u1ED9t s\u1ED1 xu h\u01B0\u1EDBng \u1EA5n t\u01B0\u1EE3ng b\u1EA1n c\xF3 th\u1EC3 tham kh\u1EA3o trong blog c\u1EE7a m\xECnh.</p><h3 id="_2-phong-cach-truyen-cam-hung" tabindex="-1"><a class="header-anchor" href="#_2-phong-cach-truyen-cam-hung" aria-hidden="true">#</a> <strong><strong>2. Phong c\xE1ch truy\u1EC1n c\u1EA3m h\u1EE9ng</strong></strong></h3><p>Thi\u1EBFt k\u1EBF c\u1EE7a b\u1EA1n ch\u1ECBu \u1EA3nh h\u01B0\u1EDFng b\u1EDFi ai? Theo phong c\xE1ch n\xE0o? Ch\u1EAFc ch\u1EAFn l\xE0 c\xF3 \u0111\xFAng kh\xF4ng! Trong Photoshop, khi thi\u1EBFt k\u1EBF, b\u1EA1n c\xF3 th\u1EC3 l\u1EF1a ch\u1ECDn m\u1ED9t s\u1ED1 phong c\xE1ch/phong tr\xE0o thi\u1EBFt k\u1EBF \u0111\u1EB7c bi\u1EC7t, c\u1ED1 \u0111\u1ECBnh \u0111\u1EC3 theo \u0111u\u1ED5i nh\u01B0:</p><h4 id="phong-trao-bauhaus" tabindex="-1"><a class="header-anchor" href="#phong-trao-bauhaus" aria-hidden="true">#</a> <strong>- Phong tr\xE0o Bauhaus:</strong></h4><p>Phong tr\xE0o bauhaus sau 100 n\u0103m c\u0169ng \u0111\xE3 \u0111\u1EC3 l\u1EA1i m\u1ED9t v\xE0i \u0111i\u1EC3m nh\u1EA5n \u1EA5n t\u01B0\u1EE3ng v\xE0 \u0111\u1EB7c tr\u01B0ng \u0111\u1EC3 nh\u1EEFng ng\u01B0\u1EDDi h\u1ECDc Photoshop theo \u0111u\u1ED5i:</p><p>Phong tr\xE0o Bauhaus v\u1EDBi c\xE1c m\xE0u s\u1EAFc c\u01A1 b\u1EA3n: \u0110\u1ECF, v\xE0ng, xanh d\u01B0\u01A1ng. Ho\u1EB7c \u0111en, tr\u1EAFng \u0111i c\xF9ng v\u1EDBi m\u1ED9t m\xE0u duy nh\u1EA5t, nh\u01B0 \u0111\u1ECF hay xanh.</p><p>\u0110\u1ED3 h\u1ECDa \u201Cgi\u1EA3i ph\u1EABu\u201D: C\xE1c h\xECnh v\u1EBD t\xE1ch r\u1EDDi v\xE0 c\xE1c b\u1ED9 ph\u1EADn c\u01A1 th\u1EC3 ng\u01B0\u1EDDi, nh\u01B0 tay v\xE0 m\u1EAFt, th\u01B0\u1EDDng \u0111\u01B0\u1EE3c s\u1EED d\u1EE5ng trong c\xE1c thi\u1EBFt k\u1EBF poster c\u1EE7a Bauhaus, mang phong c\xE1ch si\xEAu th\u1EF1c.</p><p><img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1563370968ViBugmp4pEX73y2.jpg"></p><p>B\u1ED1 c\u1EE5c th\u1EED nghi\u1EC7m (Experimental layouts) v\xE0 \u201Cph\xE1 v\u1EE1\u201D l\u01B0\u1EDBi. T\u01B0\u1EDFng nh\u01B0 tr\xE0o l\u01B0u s\u1EED d\u1EE5ng b\u1ED1 c\u1EE5c kh\xF4ng l\u01B0\u1EDBi v\xE0o th\u1EADp ni\xEAn 90 do David Carson kh\u1EDFi x\u01B0\u1EDBng, nh\u01B0ng th\u1EADt ra t\u1EEB 70 n\u0103m tr\u01B0\u1EDBc c\xE1c sinh vi\xEAn \u1EDF Bauhaus \u0111\xE3 b\u1ECF \u0111i h\u1EC7 th\u1ED1ng l\u01B0\u1EDBi c\u1EE9ng nh\u1EAFc trong c\xE1c thi\u1EBFt k\u1EBF c\u1EE7a m\xECnh r\u1ED3i. V\xE0 nh\u1EEFng ng\u01B0\u1EDDi h\u1ECDc Photoshop hi\u1EC7n gi\u1EDD c\u0169ng c\xF3 m\u1ED9t b\u1ED9 ph\u1EADn ti\u1EBFp t\u1EE5c b\u1ED1 c\u1EE5c th\u1EED nghi\u1EC7m n\xE0y c\u1EE7a phong tr\xE0o bauhaus. Ngo\xE0i ra, phong tr\xE0o bauhaus c\u0169ng c\xF3 \u0111\u1EB7c tr\u01B0ng l\xE0 ki\u1EC3u ch\u1EEF h\xECnh h\u1ECDc v\xE0 t\u1ED1i gi\u1EA3n.</p><h4 id="nostalgia-art" tabindex="-1"><a class="header-anchor" href="#nostalgia-art" aria-hidden="true">#</a> <strong>- Nostalgia Art:</strong></h4><p>N\u1ED5i b\u1EADt trong th\u1EADp ni\xEAn 90s - th\u1EDDi huy ho\xE0ng c\u1EE7a rock, graffiti, nostalgia art c\u0169ng c\xF3 s\u1EF1 n\u1ED5i lo\u1EA1n c\u1EE7a n\xF3. \u0110i\u1EC1u \u0111\xF3 th\u1EC3 hi\u1EC7n \u1EDF c\xE1c thi\u1EBFt k\u1EBF kh\xF4ng tu\xE2n theo quy lu\u1EADt n\xE0o. C\xE1c y\u1EBFu t\u1ED1 trong thi\u1EBFt k\u1EBF Photoshop c\u1EE7a nostalgia art \u0111a s\u1ED1 l\xE0 \u0111\u1EADm v\xE0 v\xF4 \u0111\u1ECBnh.</p><h4 id="helvectia" tabindex="-1"><a class="header-anchor" href="#helvectia" aria-hidden="true">#</a> <strong>- Helvectia:</strong></h4><p>Kh\xF4ng ph\u1EA3i m\u1ED9t phong c\xE1ch hay phong tr\xE0o, nh\u01B0ng b\u1ED9 font ch\u1EEF helvectia c\u0169ng \u1EA3nh h\u01B0\u1EDFng nhi\u1EC1u t\u1EDBi thi\u1EBFt k\u1EBF Photoshop th\u1EADp ni\xEAn 2000. \u0110a s\u1ED1 c\xE1c thi\u1EBFt k\u1EBF \u0111\u1EC1u s\u1EED d\u1EE5ng b\u1ED9 font ch\u1EEF s\u1EA1ch s\u1EBD v\xE0 tinh t\u1EBF c\u1EE7a helvectia. V\u1EDBi s\u1EF1 linh ho\u1EA1t v\xE0 d\u1EC5 d\xE0ng s\u1EED d\u1EE5ng g\u1EA7n nh\u01B0 trong m\u1ECDi ho\xE0n c\u1EA3nh, helvectia tr\u1EDF th\xE0nh b\u1ED9 font &quot;qu\u1ED1c d\xE2n&quot;, tho\xE1t ra kh\u1ECFi ph\u1EA1m vi m\u1ED9t b\u1ED9 font ch\u1EEF trong h\u1EC7 th\u1ED1ng t\xE0u \u0111i\u1EC7n ng\u1EA7m New York.</p><h3 id="_3-giao-trinh-photoshop" tabindex="-1"><a class="header-anchor" href="#_3-giao-trinh-photoshop" aria-hidden="true">#</a> <strong><strong>3. Gi\xE1o tr\xECnh Photoshop</strong></strong></h3><p>\u0110\u01B0\u01A1ng nhi\xEAn r\u1ED3i, gi\xE1o tr\xECnh Photoshop l\xE0 c\xE1ch \u0111\u01A1n gi\u1EA3n v\xE0 h\u1EC7 th\u1ED1ng gi\xFAp b\u1EA1n h\u1ECDc Photoshop khi m\u1EDBi b\u1EAFt \u0111\u1EA7u. V\u1EADy gi\xE1o tr\xECnh Photoshop n\xE0o ch\u1EA5t l\u01B0\u1EE3ng v\xE0 ph\xF9 h\u1EE3p v\u1EDBi l\u1ED9 tr\xECnh h\u1ECDc Photoshop c\u01A1 b\u1EA3n c\u1EE7a b\u1EA1n ?</p><p>M\u1ED9t s\u1ED1 ngu\u1ED3n s\xE1ch Photoshop c\xF3 th\u1EC3 tham kh\u1EA3o trong qu\xE1 tr\xECnh t\u1EF1 h\u1ECDc Photoshop cs6 nh\u01B0 : Photoshop CS6 All in One for dummies, Adobe Photoshop CS6 Classroom in a Book,Teach yourself Photoshop CS6, Graphic Design Portfolio Builder\u2026</p><p>C\xF3 v\u1EBB s\u1EBD th\u1EED th\xE1ch s\u1EF1 ki\xEAn nh\u1EABn \u0111\xE2y, nh\u01B0ng n\xF3 s\u1EBD gi\xFAp b\u1EA1n t\u1ED5ng h\u1EE3p ki\u1EBFn th\u1EE9c v\xE0 h\u1ECDc t\u1EADp kh\xE1 t\u1ED1t \u0111\xF3! C\xE1c gi\xE1o tr\xECnh Photoshop tr\xEAn \u0111\u1EC1u l\xE0 c\xE1c ngu\u1ED3n s\xE1ch Photoshop n\u01B0\u1EDBc ngo\xE0i ch\xEDnh th\u1ED1ng, \u0111\u01B0\u1EE3c gi\u1EDBi thi\u1EC7u nhi\u1EC1u tr\xEAn c\xE1c di\u1EC5n \u0111\xE0n. \u0110\u1EC3 l\u1EF1a ch\u1ECDn m\u1ED9t cu\u1ED1n s\xE1ch Photoshop ph\xF9 h\u1EE3p, b\u1EA1n n\xEAn \u0111\u1ECDc qua c\xE1c t\xF3m t\u1EAFt n\u1ED9i dung c\u1EE7a t\u1EEBng cu\u1ED1n s\xE1ch. Ngo\xE0i ra, m\u1ED7i gi\xE1o tr\xECnh Photoshop c\xF3 \u0111\u1EB7c tr\u01B0ng ri\xEAng, n\u1EBFu l\xE0 ng\u01B0\u1EDDi m\u1EDBi b\u1EAFt \u0111\u1EA7u h\u1ECDc Photoshop, h\xE3y l\u1EF1a ch\u1ECDn c\xE1c cu\u1ED1n gi\xE1o tr\xECnh Photoshop cs6 c\u01A1 b\u1EA3n v\u1EDBi c\xE1c h\u01B0\u1EDBng d\u1EABn s\u01A1 c\u1EA5p v\xE0 c\xF4ng c\u1EE5 c\u01A1 b\u1EA3n nh\u01B0: c\xE1ch s\u1EED d\u1EE5ng pentool trong Photoshop, m\xE0u s\u1EAFc trong Photoshop, v\u1EBD \u0111\u01B0\u1EDDng th\u1EB3ng trong Photoshop ...</p><h1 id="huong-dan-su-dung-photoshop-cho-nguoi-moi" tabindex="-1"><a class="header-anchor" href="#huong-dan-su-dung-photoshop-cho-nguoi-moi" aria-hidden="true">#</a> H\u01B0\u1EDBng d\u1EABn s\u1EED d\u1EE5ng Photoshop cho ng\u01B0\u1EDDi m\u1EDBi</h1><h2 id="_1-the-layer-tool" tabindex="-1"><a class="header-anchor" href="#_1-the-layer-tool" aria-hidden="true">#</a> 1. The Layer Tool</h2><h3 id="\u0111inh-nghia" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>Layer l\xE0 m\u1ED9t trong nh\u1EEFng c\xF4ng c\u1EE5 t\u1ED1t nh\u1EA5t c\u1EE7a Photoshop. Ch\xFAng gi\u1ED1ng nh\u01B0 nh\u1EEFng t\u1EDD gi\u1EA5y ri\xEAng bi\u1EC7t \u0111\u01B0\u1EE3c s\u1EAFp x\u1EBFp theo m\u1ED9t tr\xECnh t\u1EF1 \u0111\u1EC3 t\u1EA1o ra m\u1ED9t h\xECnh \u1EA3nh \u0111\u1EB7c bi\u1EC7t. Ch\xFAng ta c\xF3 th\u1EC3 nh\xECn xuy\xEAn qua c\xE1c v\xF9ng trong su\u1ED1t t\u1EEB layer n\xE0y sang layer kh\xE1c, di chuy\u1EC3n c\xE1c layer \u0111\u1EC3 thi\u1EBFt l\u1EADp n\u1ED9i dung h\xECnh \u1EA3nh, k\xE9o m\u1ED9t layer l\xEAn ho\u1EB7c xu\u1ED1ng \u0111\u1EC3 \u0111\u1ECBnh v\u1ECB m\u1ED9t ph\u1EA7n t\u1EED tr\xEAn \u1EA3nh. Di chuy\u1EC3n m\u1ED9t layer r\u1EA5t \u0111\u01A1n gi\u1EA3n. Ng\u01B0\u1EDDi d\xF9ng c\u0169ng c\xF3 th\u1EC3 ch\u1EC9 \u0111\u1ECBnh \u0111\u1ED9 m\u1EDD c\u1EE7a layer \u0111\u1EC3 l\xE0m cho n\u1ED9i dung c\u1EE7a n\xF3 trong su\u1ED1t m\u1ED9t ph\u1EA7n ho\u1EB7c trong su\u1ED1t ho\xE0n to\xE0n.</p><p>S\u1EED d\u1EE5ng layer, ch\xFAng ta c\xF3 th\u1EC3 th\u1EF1c hi\u1EC7n c\xE1c t\xE1c v\u1EE5 nh\u01B0 s\u1EAFp x\u1EBFp b\u1ED1 c\u1EE5c c\u1EE7a nhi\u1EC1u h\xECnh \u1EA3nh, th\xEAm v\u0103n b\u1EA3n v\xE0o h\xECnh \u1EA3nh, th\xEAm h\xECnh d\u1EA1ng, v.v... Ch\xFAng ta c\u0169ng c\xF3 th\u1EC3 \xE1p d\u1EE5ng m\u1ED9t ki\u1EC3u layer \u0111\u1EC3 cung c\u1EA5p hi\u1EC7u \u1EE9ng \u0111\u1EB7c bi\u1EC7t nh\u01B0 ph\xE1t s\xE1ng ho\u1EB7c \u0111\u1ED5 b\xF3ng cho m\u1ED9t layer. Ch\xFAng ta c\xF3 th\u1EC3 th\xEAm ho\u1EB7c x\xF3a m\u1ED9t layer b\u1EA5t c\u1EE9 l\xFAc n\xE0o trong khi l\xE0m vi\u1EC7c. Vi\u1EC7c qu\u1EA3n l\xFD c\xE1c layer v\xE0 l\xE0m vi\u1EC7c v\u1EDBi ch\xFAng t\u01B0\u01A1ng \u0111\u1ED1i \u0111\u01A1n gi\u1EA3n.</p><p><img src="data:image/jpeg;base64," alt="C\xE1c layer trong Photoshop"></p><p>L\u1EDBp l\xE0 m\u1ED9t t\xEDnh n\u0103ng thi\u1EBFt y\u1EBFu c\u1EE7a Photoshop; kh\xF4ng th\u1EC3 t\u1EA1o ra th\u1EE9 g\xEC \u0111\xF3 s\xE1ng t\u1EA1o m\xE0 kh\xF4ng s\u1EED d\u1EE5ng layer. Layer r\u1EA5t c\u1EA7n thi\u1EBFt \u0111\u1EC3 t\u1EA1o m\u1ED9t h\xECnh \u1EA3nh phong c\xE1ch ho\u1EB7c b\u1EA5t k\u1EF3 t\xE1c ph\u1EA9m \u0111\u1ED3 h\u1ECDa n\xE0o kh\xE1c. Kh\xF4ng d\u1EC5 \u0111\u1EC3 l\xE0m vi\u1EC7c v\u1EDBi m\u1ECDi th\xE0nh ph\u1EA7n c\u1EE7a h\xECnh \u1EA3nh c\xF9ng m\u1ED9t l\xFAc m\xE0 kh\xF4ng \u1EA3nh h\u01B0\u1EDFng \u0111\u1EBFn c\xE1c ph\u1EA7n kh\xE1c c\u1EE7a h\xECnh \u1EA3nh.</p><p>Theo m\u1EB7c \u0111\u1ECBnh, kh\xF4ng gian l\xE0m vi\u1EC7c Essentials c\u1EE7a Photoshop ch\u1EE9a b\u1EA3ng \u0111i\u1EC1u khi\u1EC3n layer, n\u01A1i c\xF3 th\u1EC3 nh\xECn th\u1EA5y v\xE0 qu\u1EA3n l\xFD t\u1EA5t c\u1EA3 c\xE1c layer. N\u1EBFu n\xF3 kh\xF4ng c\xF3 s\u1EB5n, b\u1EA1n c\xF3 th\u1EC3 hi\u1EC3n th\u1ECB b\u1EB1ng c\xE1ch \u0111i\u1EC1u h\u01B0\u1EDBng menu <strong>Window &gt; Layers</strong> ho\u1EB7c b\u1EB1ng c\xE1ch nh\u1EA5n ph\xEDm <strong>F7.</strong></p><h3 id="vi-tri" tabindex="-1"><a class="header-anchor" href="#vi-tri" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>M\u1EB7c \u0111\u1ECBnh n\xF3 c\xF3 m\xF4 \u0111un ri\xEAng \u1EDF g\xF3c b\xEAn ph\u1EA3i c\u1EE7a m\xE0n h\xECnh Photoshop. K\xEDch v\xE0o <strong>Layer</strong> trong thanh menu tr\xEAn c\xF9ng.</p><p><img src="data:image/jpeg;base64," alt="Menu Layer trong Photoshop"></p><h3 id="meo" tabindex="-1"><a class="header-anchor" href="#meo" aria-hidden="true">#</a> M\u1EB9o</h3><p>Lu\xF4n \u0111\u1EB7t t\xEAn cho t\u1EEBng layer \u0111\u1EC3 c\xF3 th\u1EC3 b\xE1m s\xE1t c\xE1c tr\xECnh t\u1EF1 tr\xE1nh b\u1ECB r\u1ED1i, \u0111\u1EB7c bi\u1EC7t h\u1EEFu \xEDch khi \u0111ang l\xE0m d\u1EF1 \xE1n v\u1EDBi s\u1ED1 l\u01B0\u1EE3ng layer l\u1EDBn.</p><h3 id="\u0111e-them-hoac-xoa-layer" tabindex="-1"><a class="header-anchor" href="#\u0111e-them-hoac-xoa-layer" aria-hidden="true">#</a> \u0110\u1EC3 th\xEAm ho\u1EB7c x\xF3a layer</h3><p>Ch\u1ECDn <strong>Layer</strong> &gt; <strong>New</strong> &gt; <strong>Layer...</strong></p><h3 id="chon-mot-layer" tabindex="-1"><a class="header-anchor" href="#chon-mot-layer" aria-hidden="true">#</a> Ch\u1ECDn m\u1ED9t layer</h3><p>Layer \u0111\u01B0\u1EE3c ch\u1ECDn s\u1EBD hi\u1EC3n th\u1ECB m\xE0u xanh. \u0110\u1EC3 s\u1EEDa m\u1ED9t ph\u1EA7n chi ti\u1EBFt c\u1EE7a b\u1EE9c \u1EA3nh, b\u1EA1n c\u1EA7n ch\u1ECDn v\xE0o layer \u0111\xF3.</p><p>H\xE3y ch\xFA \xFD \u0111\u1EBFn bi\u1EC3u t\u01B0\u1EE3ng con m\u1EAFt b\xEAn c\u1EA1nh m\u1ED7i layer. K\xEDch v\xE0o bi\u1EC3u t\u01B0\u1EE3ng \u0111\u1EC3 b\u1EADt/t\u1EAFt con m\u1EAFt, do \u0111\xF3 thay \u0111\u1ED5i kh\u1EA3 n\u0103ng hi\u1EC3n th\u1ECB c\u1EE7a layer b\u1EA1n \u0111ang ch\u1EC9nh s\u1EEDa.</p><h3 id="nhan-ban-mot-layer" tabindex="-1"><a class="header-anchor" href="#nhan-ban-mot-layer" aria-hidden="true">#</a> Nh\xE2n b\u1EA3n m\u1ED9t layer</h3><p>\u0110\u1EA7u ti\xEAn, ch\u1ECDn <strong>m\u1ED9t ho\u1EB7c nhi\u1EC1u layer</strong> trong b\u1EA3ng \u0111i\u1EC1u khi\u1EC3n <strong>Layers</strong>. Ti\u1EBFp theo, k\xE9o m\u1ED9t ho\u1EB7c nhi\u1EC1u layer v\xE0 \u1EA5n <strong>Create a New Layer</strong>. C\xE1ch kh\xE1c, \u1EA5n chu\u1ED9t tr\xE1i v\xE0o Layer \u0111\u1EC3 ch\u1ECDn <strong>Duplicate Layer</strong> ho\u1EB7c <strong>Duplicate Group.</strong> Nh\u1EADp t\xEAn c\u1EE7a layer v\xE0 \u1EA5n <strong>OK.</strong></p><h2 id="_2-the-color-swatches-tool" tabindex="-1"><a class="header-anchor" href="#_2-the-color-swatches-tool" aria-hidden="true">#</a> 2. The Color &amp; Swatches Tool</h2><h3 id="\u0111inh-nghia-1" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-1" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 Color v\xE0 Swatches cho ph\xE9p b\u1EA1n s\u1EED d\u1EE5ng, thay \u0111\u1ED5i, sao ch\xE9p v\xE0 l\u01B0u tr\u1EEF t\u1EA1o m\xE0u cho n\u1ED9i d\u1EE5ng c\u1EE7a b\u1EA1n. N\xF3 th\u1EF1c s\u1EF1 l\xE0 t\xEDnh n\u0103ng v\u01B0\u1EE3t tr\u1ED9i gi\xFAp h\xECnh \u1EA3nh tr\u1EDF n\xEAn s\u1ED1ng \u0111\u1ED9ng v\xE0 th\u1ED1ng nh\u1EA5t v\u1EC1 m\xE0u s\u1EAFc.</p><h3 id="vi-tri-1" tabindex="-1"><a class="header-anchor" href="#vi-tri-1" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>N\xF3 l\xE0 m\xF4 \u0111un m\u1EB7c \u0111\u1ECBnh \u1EDF g\xF3c ph\xEDa tr\xEAn b\xEAn ph\u1EA3i c\u1EE7a Photoshop.</p><p><img src="data:image/jpeg;base64," alt="Danh s\xE1ch Color trong Photoshop"></p><p>Ngo\xE0i ra, c\xF4ng c\u1EE5 Color c\xF2n n\u1EB1m \u1EDF v\u1ECB tr\xED d\u01B0\u1EDBi c\xF9ng c\u1EE7a thanh c\xF4ng c\u1EE5 b\xEAn tr\xE1i, bi\u1EC3u di\u1EC5n b\u1EDFi 2 h\u1ED9p m\xE0u ch\u1ED3ng l\xEAn nhau.</p><p><img src="data:image/jpeg;base64," alt="Bi\u1EC3u t\u01B0\u1EE3ng b\u1EA3ng m\xE0u trong Photoshop"></p><h3 id="tao-mau" tabindex="-1"><a class="header-anchor" href="#tao-mau" aria-hidden="true">#</a> T\u1EA1o m\xE0u</h3><p>M\u1EDF <strong>Color Picker</strong> b\u1EB1ng c\xE1ch k\xEDch \u0111\xFAp v\xE0o h\u1ED9p ph\xEDa tr\xEAn c\u1EE7a m\xF4 \u0111un <strong>Color</strong> ho\u1EB7c \u1EDF menu b\xEAn tr\xE1i.</p><p>T\u1EEB \u0111\xF3, b\u1EA1n s\u1EBD th\u1EA5y m\u1ED9t chu\u1ED7i c\u1ED9t m\xE0u c\xF9ng v\u1EDBi thanh tr\u01B0\u1EE3t. B\u1EA1n c\xF3 th\u1EC3 \u0111i\u1EC1u ch\u1EC9nh \u0111\u1EC3 t\u1EA1o m\xE0u t\xF9y \xFD. H\u01A1n n\u1EEFa, n\u1EBFu b\u1EA1n bi\u1EBFt gi\xE1 tr\u1ECB hex c\u1EE7a m\xE0u, hay nh\u1EADp n\xF3 v\xE0o h\u1ED9p # \u0111\u1EC3 t\xECm m\xE0u t\u1EF1 \u0111\u1ED9ng. B\u1EA1n c\xF3 th\u1EC3 ch\u1ECDn m\u1EA3ng m\xE0u d\u1EF1a tr\xEAn gi\xE1 tr\u1ECB RGB ho\u1EB7c CMYK.</p><p><img src="data:image/jpeg;base64," alt="M\u1EDF Color Picker trong Photoshop"></p><p>B\u1EA5t k\u1EF3 m\xE0u n\xE0o b\u1EA1n t\u1EA1o ra \u0111\u1EC1u c\xF3 th\u1EC3 th\xEAm Swatches n\u1EBFu click v\xE0o Add to Swatches.</p><h3 id="meo-1" tabindex="-1"><a class="header-anchor" href="#meo-1" aria-hidden="true">#</a> M\u1EB9o</h3><p>T\u1EA1o v\xE0 l\u01B0u m\xE0u nh\u01B0 &quot;Swatches&quot; \u0111\u1EC3 t\xE1i s\u1EED d\u1EE5ng cho c\xE1c l\u1EA7n ch\u1EC9nh s\u1EEDa sau.</p><h2 id="_3-tao-phong-va-text-tool" tabindex="-1"><a class="header-anchor" href="#_3-tao-phong-va-text-tool" aria-hidden="true">#</a> 3. T\u1EA1o ph\xF4ng v\xE0 Text Tool</h2><h3 id="\u0111inh-nghia-2" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-2" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 Text cho ph\xE9p th\xEAm fonts t\xF9y ch\u1EC9nh t\u1EEB d\u1EEF li\u1EC7u v\xE0 truy c\u1EADp v\xE0o c\xE0i \u0111\u1EB7t font cao c\u1EA5p.</p><h3 id="vi-tri-2" tabindex="-1"><a class="header-anchor" href="#vi-tri-2" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>\u1EDE g\xF3c b\xEAn tr\xE1i m\xE0n h\xECnh g\u1EA7n cu\u1ED1i c\xF9ng.</p><p><img src="data:image/jpeg;base64," alt="Bi\u1EC3u t\u01B0\u1EE3ng Textbox tr\xEAn Photoshop"></p><p>Khi b\u1EA1n k\xEDch v\xE0o bi\u1EC3u t\u01B0\u1EE3ng c\xF4ng c\u1EE5 <strong>Text</strong>, t\u1EA5t c\u1EA3 nh\u1EEFng c\xE0i \u0111\u1EB7t v\xE0 t\xF9y ch\u1EC9nh font s\u1EBD hi\u1EC3n th\u1ECB \u1EDF tr\xEAn c\xF9ng c\u1EE7a m\xE0n h\xECnh. Nh\u1EEFng t\xF9y ch\u1EC9nh n\xE0y cho ph\xE9p thay \u0111\u1ED5i font, k\xEDch c\u1EE1 font v\xE0 kho\u1EA3ng c\xE1ch gi\u1EEFa c\xE1c ch\u1EEF, chi\u1EC1u cao, chi\u1EC1u r\u1ED9ng, m\xE0u v\xE0 ki\u1EC3u d\xE1ng. V\xE0 ch\u1EAFc ch\u1EAFn r\u1EB1ng \u0111\xE3 ch\u1ECDn layer b\u1EA1n mong mu\u1ED1n ch\u1EC9nh s\u1EEDa ch\u1EEF.</p><p><img src="data:image/jpeg;base64," alt="Thanh c\xF4ng c\u1EE5 trong Photoshop"></p><h3 id="them-van-ban-vao-anh" tabindex="-1"><a class="header-anchor" href="#them-van-ban-vao-anh" aria-hidden="true">#</a> Th\xEAm v\u0103n b\u1EA3n v\xE0o \u1EA3nh</h3><p>C\xF4ng c\u1EE5 Text l\xE0m vi\u1EC7c gi\u1ED1ng nh\u01B0 c\xF4ng c\u1EE5 Text kh\xE1c b\u1EA1n t\u1EEBng s\u1EED d\u1EE5ng. Ch\u1ECDn bi\u1EC3u t\u01B0\u1EE3ng <strong>T</strong> \u1EDF thanh b\xEAn tr\xE1i, k\xE9o <strong>Textbox</strong> v\xE0o v\u1ECB tr\xED b\u1EA1n mu\u1ED1n v\xE0 b\xE2y gi\u1EDD h\xE3y th\u1ECFa s\u1EE9c s\xE1ng t\u1EA1o th\xF4i.</p><p>B\u1EA5t c\u1EE9 khi n\xE0o b\u1EA1n t\u1EA1o textbox, Photoshop s\u1EBD th\xEAm m\u1ED9t layer. B\u1EA1n c\xF3 th\u1EC3 ch\u1ECDn m\xE0u, k\xEDch c\u1EE1,....,c\xE1c t\xF9y ch\u1EC9nh kh\xE1c \u0111\u1EC3 thay \u0111\u1ED5i.</p><p><img src="data:image/jpeg;base64," alt="Ch\xE8n v\u0103n b\u1EA3n trong Photoshop"></p><h2 id="_4-custom-brushes-the-brush-tool" tabindex="-1"><a class="header-anchor" href="#_4-custom-brushes-the-brush-tool" aria-hidden="true">#</a> 4. Custom Brushes &amp; The Brush Tool</h2><h3 id="\u0111inh-nghia-3" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-3" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>Gi\u1ED1ng nh\u01B0 Fonts, b\u1EA1n c\xF3 th\u1EC3 th\xEAm v\xE0 ch\u1EC9nh s\u1EEDa t\xF9y \xFD. Trong c\xF4ng c\u1EE5 Brush c\xF3 nh\u1EEFng t\xEDnh n\u0103ng nh\u01B0 thay \u0111\u1ED5i k\xEDch th\u01B0\u1EDBc, h\xECnh d\xE1ng v\xE0 c\xE1c n\xE9t v\u1EBD \u0111\u1EC3 c\xF3 s\u1ED1 l\u01B0\u1EE3ng hi\u1EC7u \u1EE9ng h\xECnh \u1EA3nh kh\xE1c nhau.</p><p>Brush l\xE0 c\xE1ch t\u1ED1t \u0111\u1EC3 th\xEAm h\xECnh \u1EA3nh \u0111i\u1EC3m nh\u1EA5n b\u1EAFt m\u1EAFt t\u1EDBi n\u1ED9i d\u1EE5ng. Trong Photoshop, b\u1EA1n s\u1EBD ph\u1EA3i b\u1EAFt \u0111\u1EA7u v\u1EDBi nh\u1EEFng l\u1EF1a ch\u1ECDn c\u1EE7a Brush tips. B\u1EA1n c\xF3 th\u1EC3 s\u1EED d\u1EE5ng \u0111\u1EC3 l\xE0m r\xF5 n\xE9t v\xE0 t\u1EA1o hi\u1EC7u \u1EE9ng h\xECnh \u1EA3nh c\u01A1 b\u1EA3n.</p><h3 id="vi-tri-3" tabindex="-1"><a class="header-anchor" href="#vi-tri-3" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>N\u1EB1m \u1EDF thanh c\xF4ng c\u1EE5 b\xEAn tr\xE1i.</p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 Brush tr\xEAn Photoshop"></p><p>Khi ch\u1ECDn c\xF4ng c\u1EE5 Brush, t\u1EA5t c\u1EA3 c\xE1c c\xE0i \u0111\u1EB7t v\xE0 t\xF9y ch\u1ECDn Brush s\u1EBD xu\u1EA5t hi\u1EC7n ph\xEDa tr\xEAn c\u1EE7a m\xE0n h\xECnh. C\xE1c c\xE0i \u0111\u1EB7t n\xE0y cho ph\xE9p b\u1EA1n \u0111i\u1EC1u ch\u1EC9nh k\xEDch c\u1EE1 c\u1ECD, \u0111\u1ED9 m\u1EDD,..</p><p><img src="data:image/jpeg;base64," alt="Thanh c\xF4ng c\u1EE5 Brush c\u1EE7a Photoshop"></p><h3 id="su-dung-cong-cu-brush" tabindex="-1"><a class="header-anchor" href="#su-dung-cong-cu-brush" aria-hidden="true">#</a> S\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Brush</h3><p>C\xF4ng c\u1EE5 ph\xF9 h\u1EE3p \u0111\u1EC3 t\u1EA1o \u0111i\u1EC3m nh\u1EA5n thi\u1EBFt k\u1EBF \u0111\u1EBFn n\u1ED9i dung. T\xF4i khuy\xEAn c\xE1c b\u1EA1n khi s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Brush n\xEAn t\u1EA1o th\xEAm m\u1ED9t layer \u0111\u1EC3 tr\xE1nh \u0111\xE8 l\xEAn c\xE1c chi ti\u1EBFt kh\xE1c. M\xE0u c\xF3 th\u1EC3 \u0111\u01B0\u1EE3c ch\u1ECDn t\u1EEB th\u01B0 vi\u1EC7n Swatches ho\u1EB7c m\xE0u t\u1EF1 t\u1EA1o.</p><p>Thay \u0111\u1ED5i c\xE0i \u0111\u1EB7t Brush c\xF3 th\u1EC3 mang \u0111\u1EBFn cho thi\u1EBFt k\u1EBF m\u1ED9t phong c\xE1ch ri\xEAng v\xE0 th\u1EADm ch\xED khi\u1EBFn ng\u01B0\u1EDDi kh\xE1c kinh ng\u1EA1c. \u0110\u1EEBng ng\u1EA1i \u0111\u1EC3 ngh\u1ECBch m\u1ED9t ch\xFAt v\u1EDBi brushes.</p><h2 id="_5-select-tool" tabindex="-1"><a class="header-anchor" href="#_5-select-tool" aria-hidden="true">#</a> 5. Select Tool</h2><h3 id="\u0111inh-nghia-4" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-4" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>Khi s\u1EED d\u1EE5ng \u0111\xFAng c\xE1ch, c\xF4ng c\u1EE5 n\xE0y cho ph\xE9p l\u1EF1a ch\u1ECDn chi ti\u1EBFt, t\u1EA1o \u0111\u1ED3 h\u1ECDa, sao ch\xE9p, c\u1EAFt, v\xE0 d\xE1n v\xE0o \u1EA3nh.</p><h3 id="vi-tri-4" tabindex="-1"><a class="header-anchor" href="#vi-tri-4" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>Tr\xEAn thanh c\xF4ng c\u1EE5 b\xEAn tr\xE1i.</p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 Select tr\xEAn Photoshop"></p><p>C\xF4ng c\u1EE5 Select \u0111\u01B0\u1EE3c bi\u1EBFt \u0111\u1EBFn l\xE0 m\u1ED9t trong nh\u1EEFng c\xF4ng c\u1EE5 c\u01A1 b\u1EA3n nh\u1EA5t, nh\u01B0ng kh\xF4ng c\xF3 ngh\u0129a l\xE0 c\xF4ng c\u1EE5 kh\xF4ng hi\u1EC7u qu\u1EA3. \u0110i\u1EC1u c\u1EA7n c\u1EE7a c\xF4ng c\u1EE5 n\xE0y l\xE0 n\xF3 ch\u1EC9 ho\u1EA1t \u0111\u1ED9ng khi \u0111\xE3 ch\u1ECDn layer. V\xEC v\u1EADy, n\u1EBFu b\u1EA1n mu\u1ED1n c\u1EAFt ho\u1EB7c sao ch\xE9p m\u1ED9t khu v\u1EF1c tr\xEAn Layer 4 th\xEC ph\u1EA3i ch\u1ECDn Layer 4, \u0111\u1ED3ng ngh\u0129a v\u1EDBi vi\u1EC7c n\xF3 \u0111ang \u0111\u01B0\u1EE3c t\xF4 s\xE1ng trong thanh Layers. V\xE0 khu v\u1EF1c \u0111\xE3 ch\u1ECDn \u0111\u01B0\u1EE3c \u0111\xE1nh d\u1EA5u b\u1EDFi \u0111\u01B0\u1EDDng \u0111\u1EE9t \u0111o\u1EA1n, nh\u1EA5p nh\xE1y.</p><p><img src="data:image/jpeg;base64," alt="C\xE1c c\xF4ng c\u1EE5 tr\xEAn Photoshop"></p><p>B\u1EA1n n\xEAn ch\xFA \xFD t\u1EDBi layer \u0111ang d\xF9ng th\xEC s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 n\xE0y s\u1EBD tr\u1EDF n\xEAn d\u1EC5 d\xE0ng h\u01A1n.</p><p>\u0110\u1EA7u ti\xEAn, ch\u1ECDn khu v\u1EF1c. Sau \u0111\xF3, k\xEDch chu\u1ED9t ph\u1EA3i v\xE0 ch\u1ECDn t\xF9y ch\u1EC9nh t\u1EEB menu \u0111\u01B0\u1EE3c x\u1ED5 ra. V\xED d\u1EE5, b\u1EA1n c\xF3 th\u1EC3 l\u1EA5y ra v\xE0i \u0111\u1ED1i t\u01B0\u1EE3ng t\u1EEB layer hi\u1EC7n t\u1EA1i v\xE0 t\u1EA1o m\u1ED9t layer ri\xEAng.</p><p><img src="data:image/jpeg;base64," alt="L\u1EF1a ch\u1ECDn Layer tr\xEAn Photoshop"></p><h3 id="lam-the-nao-\u0111e-chon-buc-anh-\u0111e-chen-vao-\u0111o-hoa" tabindex="-1"><a class="header-anchor" href="#lam-the-nao-\u0111e-chon-buc-anh-\u0111e-chen-vao-\u0111o-hoa" aria-hidden="true">#</a> L\xE0m th\u1EBF n\xE0o \u0111\u1EC3 ch\u1ECDn b\u1EE9c \u1EA3nh \u0111\u1EC3 ch\xE8n v\xE0o \u0111\u1ED3 h\u1ECDa</h3><p>M\u1EDF h\xECnh \u1EA3nh b\u1EA1n mu\u1ED1n ch\xE8n trong Photoshop v\xE0 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Select \u0111\u1EC3 x\xE1c \u0111\u1ECBnh xem b\u1EA1n mu\u1ED1n l\u1EA5y khu v\u1EF1c n\xE0o c\u1EE7a \u1EA3nh. Sau \u0111\xF3, sao ch\xE9p n\xF3.</p><p>Ti\u1EBFp theo, m\u1EDF tab cho d\u1EF1 \xE1n c\u1EA7n ch\xE8n v\xE0 d\xE1n v\xE0o nh\u01B0 m\u1ED9t layer m\u1EDBi. B\u1EADt layer c\u1EE7a \u0111\u1ED1i t\u01B0\u1EE3ng b\u1EA1n mu\u1ED1n ch\u1ECDn. H\u01A1n n\u1EEFa, c\xF3 th\u1EC3 di chuy\u1EC3n nhi\u1EC1u \u0111\u1ED1i t\u01B0\u1EE3ng khi b\u1EADt nhi\u1EC1u layer.</p><p>B\u01B0\u1EDBc ti\u1EBFp, k\xEDch chu\u1ED9t ph\u1EA3i v\xE0 c\xF3 m\u1ED9t v\xE0i t\xF9y ch\u1ECDn nh\u01B0 sau:</p><ul><li>Ch\u1ECDn <strong>Layer via Copy</strong> \u0111\u1EC3 sao ch\xE9p \u0111\u1ED1i t\u01B0\u1EE3ng t\u1EEB layer \u0111\xF3 v\xE0 t\u1EA1o m\u1ED9t layer cho \u0111\u1ED1i t\u01B0\u1EE3ng.</li></ul><p><strong>Th\u1EE7 thu\u1EADt Pro h\u01A1n:</strong></p><ul><li>\u0110\u1EC3 ch\u1ECDn to\xE0n b\u1ED9 h\xECnh \u1EA3nh bao g\u1ED3m t\u1EA5t c\u1EA3 c\xE1c layer, b\u1EADt \u0111\u1ED3ng th\u1EDDi t\u1EA5t c\u1EA3 c\xE1c layer v\xE0 k\xEDch <strong>Select Tool</strong>. Khi b\u1EA1n x\xE1c \u0111\u1ECBnh \u0111\u01B0\u1EE3c khu v\u1EF1c sao ch\xE9p, s\u1EED d\u1EE5ng thanh menu \u1EDF tr\xEAn c\xF9ng k\xEDch <strong>Edit</strong> &gt; <strong>Copy Merged</strong>. Cu\u1ED1i c\xF9ng, to\xE0n b\u1ED9 h\xECnh \u1EA3nh s\u1EBD \u0111\u01B0\u1EE3c sao ch\xE9p v\xE0 d\xE1n v\xE0o layer c\u1EE7a n\xF3. <ul><li>Ch\u1ECDn <strong>Free Transform</strong> \u0111\u1EC3 c\u0103n, xoay, di chuy\u1EC3n v\xE0 l\u1EADt v\u1EADt b\u1EA1n l\u1EF1a ch\u1ECDn.</li></ul></li><li>M\u1ED9t m\u1EB9o c\u1EF1c k\u1EF3 h\u1EEFu \xEDch n\u1EEFa m\xE0 b\u1EA1n c\xF3 th\u1EC3 s\u1EED d\u1EE5ng v\u1EDBi Free Transform l\xE0 t\u1EA1o l\u1EDBp ph\u1EE7 b\u1EB1ng \u1EA3nh ch\u1EE5p file PDF gi\xFAp h\xECnh \u1EA3nh tr\xF4ng gi\u1ED1ng \u1EA3nh 3D, nh\u01B0 h\xECnh \u1EA3nh d\u01B0\u1EDBi \u0111\xE2y.</li></ul><p><img src="data:image/jpeg;base64," alt="T\u1EA1o \u1EA3nh ki\u1EC3u 3D"></p><h2 id="_6-move-tool" tabindex="-1"><a class="header-anchor" href="#_6-move-tool" aria-hidden="true">#</a> 6. Move Tool</h2><h3 id="\u0111inh-nghia-5" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-5" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>Khi n\xF3i \u0111\u1EBFn Photoshop, m\u1ED9t s\u1ED1 ch\u1EE9c n\u0103ng \u0111\u01A1n gi\u1EA3n nh\u1EA5t c\xF3 th\u1EC3 mang l\u1EA1i nhi\u1EC1u l\u1EE3i \xEDch \u0111\xE1ng kinh ng\u1EA1c. C\xF4ng c\u1EE5 Move c\xF3 v\u1EBB t\u1EA7m th\u01B0\u1EDDng. Tuy nhi\xEAn, tr\xEAn th\u1EF1c t\u1EBF n\xF3 cung c\u1EA5p m\u1ED9t m\u1EE9c \u0111\u1ED9 ch\u1EE9c n\u0103ng tuy\u1EC7t v\u1EDDi. N\xF3 c\xF3 kh\u1EA3 n\u0103ng t\u01B0\u01A1ng t\xE1c v\u1EDBi b\u1EA5t k\u1EF3 \u0111\u1ED1i t\u01B0\u1EE3ng n\xE0o trong t\xE0i li\u1EC7u c\u1EE7a b\u1EA1n v\xE0 \u0111i\u1EC1u \u0111\xF3 cho ph\xE9p b\u1EA1n \u0111\u1EA1t \u0111\u01B0\u1EE3c k\u1EBFt qu\u1EA3 g\u1EA7n nh\u01B0 d\u1EC5 d\xE0ng nh\u01B0 c\u1EAFt c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng th\u1EF1c th\u1EE7 c\xF4ng v\xE0 di chuy\u1EC3n ch\xFAng xung quanh trong th\u1EBF gi\u1EDBi th\u1EF1c.</p><p>\u0110\xE2y l\xE0 c\xF4ng c\u1EE5 c\u01A1 b\u1EA3n cho ph\xE9p b\u1EA1n di chuy\u1EC3n t\u1EEBng ph\u1EA7n c\u1EE7a \u1EA3nh. C\xF4ng c\u1EE5 Move ho\u1EA1t \u0111\u1ED9ng tr\xEAn t\u1EEBng layer ho\u1EB7c tr\xEAn to\xE0n b\u1ED9 h\xECnh \u1EA3nh n\u1EBFu b\u1EA1n b\u1EADt t\u1EA5t c\u1EA3 layer. C\xF4ng c\u1EE5 n\xE0y h\u1EEFu d\u1EE5ng khi b\u1EA1n c\u1ED1 g\u1EAFng \u0111\u1ECBnh v\u1ECB l\u1EA1i \u1EA3nh, v\u0103n b\u1EA3n, v\xE0 c\xE1c thi\u1EBFt k\u1EBF kh\xE1c.</p><p>G\u1EA7n nh\u01B0 b\u1EA5t k\u1EF3 \u0111\u1ED1i t\u01B0\u1EE3ng n\xE0o c\xF3 th\u1EC3 nh\u1EADn d\u1EA1ng \u0111\u01B0\u1EE3c trong giao di\u1EC7n Photoshop \u0111\u1EC1u c\xF3 th\u1EC3 di chuy\u1EC3n b\u1EB1ng c\xF4ng c\u1EE5 Move, bao g\u1ED3m:</p><ul><li>H\u1ED9p v\u0103n b\u1EA3n</li><li>V\xF9ng ch\u1ECDn</li><li>C\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng \u0111\xE3 d\xE1n</li><li>To\xE0n b\u1ED9 layer</li></ul><p>B\u1EA1n th\u1EADm ch\xED c\xF3 th\u1EC3 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 n\xE0y \u0111\u1EC3 k\xE9o c\xE1c ph\u1EA7n t\u1EED t\u1EEB t\xE0i li\u1EC7u Photoshop n\xE0y sang t\xE0i li\u1EC7u Photoshop kh\xE1c. \u0110\xF3 l\xE0 m\u1ED9t qu\xE1 tr\xECnh k\xE9o v\xE0 th\u1EA3 \u0111\u01A1n gi\u1EA3n.</p><p>C\xF4ng c\u1EE5 Move l\xE0 c\xF4ng c\u1EE5 Photoshop duy nh\u1EA5t c\xF3 th\u1EC3 \u0111\u01B0\u1EE3c s\u1EED d\u1EE5ng ngay c\u1EA3 khi n\xF3 kh\xF4ng \u0111\u01B0\u1EE3c ch\u1ECDn trong thanh c\xF4ng c\u1EE5. Ch\u1EC9 c\u1EA7n nh\u1EA5n gi\u1EEF <strong>CTRL</strong> tr\xEAn PC ho\u1EB7c <strong>COMMAND</strong> tr\xEAn m\xE1y Mac v\xE0 b\u1EA1n s\u1EBD ngay l\u1EADp t\u1EE9c k\xEDch ho\u1EA1t c\xF4ng c\u1EE5 Move b\u1EA5t k\u1EC3 c\xF4ng c\u1EE5 n\xE0o hi\u1EC7n \u0111ang ho\u1EA1t \u0111\u1ED9ng. \u0110i\u1EC1u n\xE0y gi\xFAp b\u1EA1n d\u1EC5 d\xE0ng s\u1EAFp x\u1EBFp l\u1EA1i c\xE1c y\u1EBFu t\u1ED1 c\u1EE7a m\xECnh m\u1ED9t c\xE1ch nhanh ch\xF3ng.</p><p>C\xF4ng c\u1EE5 Move c\u0169ng \u0111\u01B0\u1EE3c thi\u1EBFt k\u1EBF \u0111\u1EC3 t\u01B0\u01A1ng t\xE1c v\u1EDBi c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng 3D. B\u1EA1n c\xF3 th\u1EC3 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 n\xE0y \u0111\u1EC3 xoay \u0111\u1ED1i t\u01B0\u1EE3ng 3D c\u1EE7a m\xECnh theo b\u1EA5t k\u1EF3 h\u01B0\u1EDBng n\xE0o ho\u1EB7c \u0111\u1ECBnh v\u1ECB l\u1EA1i \u0111\u1ED1i t\u01B0\u1EE3ng trong kh\xF4ng gian 2D so v\u1EDBi c\xE1c th\xE0nh ph\u1EA7n kh\xE1c trong \u1EA3nh.</p><h3 id="vi-tri-5" tabindex="-1"><a class="header-anchor" href="#vi-tri-5" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>Tr\xEAn c\xF9ng b\xEAn ph\u1EA3i c\u1EE7a thanh c\xF4ng c\u1EE5.</p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 Move tr\xEAn Photoshop"></p><h3 id="su-dung-cong-cu-di-chuyen" tabindex="-1"><a class="header-anchor" href="#su-dung-cong-cu-di-chuyen" aria-hidden="true">#</a> S\u1EED d\u1EE5ng c\xF4ng c\u1EE5 di chuy\u1EC3n</h3><p>K\xEDch bi\u1EC3u t\u01B0\u1EE3ng <strong>Move</strong> t\u1EEB menu b\xEAn tr\xE1i v\xE0 k\xE9o \u0111\u1ED1i t\u01B0\u1EE3ng b\u1EA1n mu\u1ED1n. Di chuy\u1EC3n t\u1EA5t c\u1EA3 \u0111\u1ED1i t\u01B0\u1EE3ng tr\xEAn c\xF9ng layer, b\u1EADt layer \u0111\xF3 v\xE0 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Move. B\u1EA1n c\xF3 th\u1EC3 k\xEDch chu\u1ED9t ph\u1EA3i v\xE0o h\xECnh \u0111\u1EC3 c\xF3 nh\u1EEFng t\xF9y ch\u1EC9nh b\u1ED5 sung.</p><h3 id="\u0111e-can-xoay-di-chuyen-va-lat" tabindex="-1"><a class="header-anchor" href="#\u0111e-can-xoay-di-chuyen-va-lat" aria-hidden="true">#</a> \u0110\u1EC3 c\u0103n, xoay, di chuy\u1EC3n v\xE0 l\u1EADt</h3><p>C\xF4ng c\u1EE5 <strong>Free Transform</strong> cho ph\xE9p b\u1EA1n c\u0103n, xoay, di chuy\u1EC3n, v\xE0 l\u1EADt b\u1EA5t c\u1EE9 ph\u1EA7n n\xE0o trong layer \u0111\xE3 ch\u1ECDn. S\u1EED d\u1EE5ng t\u1ED5 h\u1EE3p ph\xEDm <strong>Ctrl/Command + T</strong> \u0111\u1EC3 kh\u1EDFi \u0111\u1ED9ng Free Tranform, v\xE0 th\u1EED c\xE1c t\xF9y ch\u1ECDn tr\xEAn thanh pop-up tr\xEAn \u0111\u1EA7u m\xE0n h\xECnh. Gi\u1EEF <strong>Shift</strong> trong khi chuy\u1EC3n \u0111\u1ED5i \u0111\u1EC3 duy tr\xEC t\u1EF7 l\u1EC7 c\u1EE7a v\u1EADt.</p><p><img src="data:image/jpeg;base64," alt="https://st.quantrimang.com/photos/image/2017/02/28/12-Photoshop-15.jpg"></p><h2 id="_7-zoom-tool" tabindex="-1"><a class="header-anchor" href="#_7-zoom-tool" aria-hidden="true">#</a> 7. Zoom Tool</h2><h3 id="\u0111inh-nghia-6" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-6" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 Zoom cho ph\xE9p zoom g\u1EA7n v\xE0o khu v\u1EF1c c\u1EE5 th\u1EC3 c\u1EE7a \u1EA3nh v\xE0 zoom xa \u0111\u1EC3 xem to\xE0n b\u1ED9 b\u1EE9c \u1EA3nh.</p><h3 id="vi-tri-6" tabindex="-1"><a class="header-anchor" href="#vi-tri-6" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>Thanh menu tr\xEAn c\xF9ng, ch\u1ECDn <strong>View</strong> &gt; <strong>Zoom In</strong> ho\u1EB7c <strong>Zoom Out.</strong></p><p><img src="data:image/jpeg;base64," alt="Zoom In trong Photoshop"></p><h3 id="su-dung-cong-cu-zoom" tabindex="-1"><a class="header-anchor" href="#su-dung-cong-cu-zoom" aria-hidden="true">#</a> S\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Zoom</h3><p>Ch\u1ECDn t\xF9y ch\u1EC9nh zoom t\u1EEB menu View. Ho\u1EB7c s\u1EED d\u1EE5ng ph\xEDm t\u1EAFt, gi\u1EEF Alt ho\u1EB7c Command k\u1EBFt h\u1EE3p \u1EA5n + \u0111\u1EC3 zoom g\u1EA7n, Alt ho\u1EB7c Command c\xF9ng v\u1EDBi n\xFAt - \u0111\u1EC3 zoom xa.</p><h2 id="_8-eraser" tabindex="-1"><a class="header-anchor" href="#_8-eraser" aria-hidden="true">#</a> 8. Eraser</h2><h3 id="\u0111inh-nghia-7" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-7" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 T\u1EA9y gi\u1ED1ng v\u1EDBi c\xF4ng c\u1EE5 Brush, b\u1EA1n c\xF3 th\u1EC3 thay \u0111\u1ED5i k\xEDch c\u1EE1 v\xE0 \u0111\u1ED9 c\u1EE9ng c\u1EE7a t\u1EA9y \u0111\u1EC3 c\xF3 nh\u1EEFng hi\u1EC7u \u1EE9ng \u0111a d\u1EA1ng gi\u1ED1ng nh\u01B0 l\xE0m m\u1EDD v\xE0 tr\u1ED9n. T\u1EA9y n\u1EC1n s\u1EED d\u1EE5ng c\xE1c m\xE0u kh\xE1c nhau \u0111\u1EC3 gi\xFAp b\u1EA1n x\xF3a nh\u1EEFng khu v\u1EF1c n\u1EC1n kh\xF4ng mong mu\u1ED1n tr\xEAn \u1EA3nh.</p><p>T\u1EA9y l\xE0 m\u1ED9t trong nh\u1EEFng c\xF4ng c\u1EE5 h\u1EEFu \xEDch trong Photoshop. Nh\u01B0ng b\u1EA1n ch\u01B0a t\u1EEBng d\xF9ng c\u1EE5c t\u1EA9y n\xE0o nh\u01B0 d\u01B0\u1EDBi \u0111\xE2y.</p><h3 id="vi-tri-7" tabindex="-1"><a class="header-anchor" href="#vi-tri-7" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>Tr\xEAn thanh c\xF4ng c\u1EE5 b\xEAn tr\xE1i.</p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 t\u1EA9y trong Photoshop"></p><h3 id="su-dung-basic-eraser" tabindex="-1"><a class="header-anchor" href="#su-dung-basic-eraser" aria-hidden="true">#</a> S\u1EED d\u1EE5ng Basic Eraser</h3><p>Khi k\xEDch v\xE0o bi\u1EC3u t\u01B0\u1EE3ng c\u1EE5c t\u1EA9y, t\u1EA5t c\u1EA3 t\xF9y ch\u1ECDn s\u1EBD hi\u1EC7n \u1EDF tr\xEAn c\xF9ng m\xE0n h\xECnh. C\xF3 c\xE1c t\xF9y ch\u1EC9nh nh\u01B0 thay \u0111\u1ED5i k\xEDch c\u1EE1 t\u1EA9y, \u0111\u1ED9 c\u1EE9ng,...</p><p>Gi\u1ED1ng v\u1EDBi h\u1EA7u h\u1EBFt c\xE1c c\xF4ng c\u1EE5 kh\xE1c trong Photoshop, t\u1EA9y ch\u1EC9 ho\u1EA1t \u0111\u1ED9ng tr\xEAn m\u1ED9t layer x\xE1c \u0111\u1ECBnh. Tr\u01B0\u1EDBc khi s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 n\xE0y, h\xE3y \u0111\u1EA3m b\u1EA3o \u0111\xE3 ch\u1ECDn layer b\u1EA1n mu\u1ED1n.</p><p><img src="data:image/jpeg;base64," alt="S\u1EED d\u1EE5ng Basic Eraser trong Photoshop"></p><h3 id="su-dung-background-eraser" tabindex="-1"><a class="header-anchor" href="#su-dung-background-eraser" aria-hidden="true">#</a> S\u1EED d\u1EE5ng Background Eraser</h3><p>C\xF4ng c\u1EE5 n\xE0y kh\xE1 ti\u1EBFt ki\u1EC7m th\u1EDDi gian. B\u1EA1n c\xF3 th\u1EC3 th\u1EA5y n\xF3 d\u1EC5 d\xE0ng lo\u1EA1i b\u1ECF m\xE0u n\u1EC1n c\u1EE7a \u1EA3nh. Kh\xE1 h\u1EEFu \xEDch khi \u1EA9n \u0111\u1ED1i t\u01B0\u1EE3ng v\u1EDBi n\u1EC1n trong su\u1ED1t.</p><p>\u0110\u1EC3 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 t\u1EA9y n\u1EC1n, ch\u1ECDn v\xE0 gi\u1EEFa bi\u1EC3u t\u01B0\u1EE3ng t\u1EA9y cho \u0111\u1EBFn khi menu c\u1EA1nh xu\u1EA5t hi\u1EC7n. Ch\u1ECDn <strong>Background Eraser</strong>.</p><p><img src="data:image/jpeg;base64," alt="Ch\u1ECDn Background tr\xEAn Photoshop"></p><p>B\xE2y gi\u1EDD b\u1EA1n \u0111\xE3 s\u1EB5n s\xE0ng x\xF3a m\u1ED9t v\xE0i th\u1EE9 g\xEC \u0111\xF3 ch\u01B0a? Ch\u1EC9nh k\xEDch c\u1EE1 Background Eraser, v\xE0 ch\u1ECDn m\xE0u b\u1EA1n mu\u1ED1n x\xF3a t\u1EEB layer \u0111\xE3 ch\u1ECDn. Nh\u1EDB ch\u1ECDn \u0111\xFAng layer.</p><p><img src="data:image/jpeg;base64," alt="X\xF3a n\u1EC1n tr\xEAn Photoshop"></p><h3 id="meo-2" tabindex="-1"><a class="header-anchor" href="#meo-2" aria-hidden="true">#</a> M\u1EB9o</h3><p>\u0110\u1EEBng ng\u1EA1i s\u1EED d\u1EE5ng t\u1EA9y k\xEDch c\u1EE1 kh\u1EE7ng c\u1EE7a Background Eraser. B\u1EDFi n\xF3 s\u1EBD x\xF3a nh\u1EEFng m\xE0u c\u1EE5 th\u1EC3 t\u1EEB \u1EA3nh ch\u1EE9 kh\xF4ng x\xF3a m\xE0u khi ch\u01B0a \u0111\u01B0\u1EE3c ch\u1ECDn.</p><h2 id="_9-crop-tool" tabindex="-1"><a class="header-anchor" href="#_9-crop-tool" aria-hidden="true">#</a> 9. Crop Tool</h2><h3 id="\u0111inh-nghia-8" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-8" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 Crop cho ph\xE9p c\u1EAFt \u1EA3nh. C\u01A1 b\u1EA3n n\xF3 ho\u1EA1t \u0111\u1ED9ng gi\u1ED1ng nh\u01B0 c\xE1c c\xF4ng c\u1EE5 c\u1EAFt kh\xE1c b\u1EA1n \u0111\xE3 t\u1EEBng s\u1EED d\u1EE5ng: X\xE1c \u0111\u1ECBnh v\u1ECB tr\xED v\xE0 c\u1EAFt b\u1ECF.</p><p>T\xF4i bi\u1EBFt \u0111\xE2y l\xE0 c\xF4ng c\u1EE5 c\u01A1 b\u1EA3n nh\u01B0ng b\u1EA1n s\u1EBD ph\u1EA3i d\xF9ng \u0111\u1EBFn n\xF3 th\u01B0\u1EDDng xuy\xEAn nh\u01B0 c\xE1c c\xF4ng c\u1EE5 kh\xE1c trong Photoshop, \u0111\u1EB7c bi\u1EC7t khi v\u1EEBa ho\xE0n th\xE0nh ch\u1EC9nh s\u1EEDa v\xE0 c\u1EA7n lo\u1EA1i b\u1ECF nh\u1EEFng ch\u1ED7 th\u1EEBa xung quanh c\xE1c g\xF3c.</p><h3 id="vi-tri-8" tabindex="-1"><a class="header-anchor" href="#vi-tri-8" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>Gi\u1ED1ng c\xE1c c\xF4ng c\u1EE5 kh\xE1c, n\xF3 n\u1EB1m tr\xEAn thanh c\xF4ng c\u1EE5 \u1EDF b\xEAn tr\xE1i.</p><p><img src="data:image/jpeg;base64," alt="V\u1ECB tr\xED c\xF4ng c\u1EE5 c\u1EAFt \u1EA3nh tr\xEAn Photoshop"></p><h3 id="su-dung-crop-tool" tabindex="-1"><a class="header-anchor" href="#su-dung-crop-tool" aria-hidden="true">#</a> S\u1EED d\u1EE5ng Crop Tool</h3><p>Ch\u1ECDn bi\u1EC3u t\u01B0\u1EE3ng Crop tr\xEAn thanh c\xF4ng c\u1EE5 b\xEAn v\xE0 di chuy\u1EC3n khung v\xE0o v\u1ECB tr\xED mu\u1ED1n b\u1ECF. \u0110\u1EC3 ch\u1EC9nh khung c\u1EAFt, \u0111\u01A1n gi\u1EA3n th\xF4i, k\xEDch v\xE0 k\xE9o c\xE1c g\xF3c v\xE0 c\u1EA1nh c\u1EE7a khung.</p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 c\u1EAFt \u1EA3nh tr\xEAn Photoshop"></p><p><strong>M\u1EB9o:</strong> B\u1EA1n c\xF3 th\u1EC3 l\xE0m cho khung thi\u1EBFt k\u1EBF r\u1ED9ng h\u01A1n \u0111\u1EC3 c\xF3 th\u1EC3 di chuy\u1EC3n c\xE1c y\u1EBFu t\u1ED1 thi\u1EBFt k\u1EBF c\u1EA7n thi\u1EBFt, sau \u0111\xF3 s\u1EED d\u1EE5ng c\xF4ng c\u1EE5 Crop \u0111\u1EC3 \u0111\u01B0a ch\xFAng v\u1EC1 k\xEDch th\u01B0\u1EDBc h\u1EE3p l\xFD.</p><h2 id="_10-the-fill-tool" tabindex="-1"><a class="header-anchor" href="#_10-the-fill-tool" aria-hidden="true">#</a> 10. The Fill Tool</h2><h3 id="\u0111inh-nghia-9" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-9" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 Fill tr\u01B0\u1EDBc \u0111\xE2y l\xE0 c\xF4ng c\u1EE5 Paint Bucket, t\xF4 m\xE0u to\xE0n b\u1ED9 khu v\u1EF1c b\u1EA1n ch\u1ECDn. Ph\xF9 h\u1EE3p cho c\xE1c ph\xF4ng n\u1EC1n ho\u1EB7c khu v\u1EF1c \u0111\u1ED5 m\xE0u l\u1EDBn. Th\xEAm v\xE0o \u0111\xF3 c\xF3 th\u1EC3 s\u1EED d\u1EE5ng n\u1EC1n h\u1ECDa ti\u1EBFt. C\xF4ng c\u1EE5 Gradient trong c\xF4ng c\u1EE5 Fill t\u1EA1o hi\u1EC7u \u1EE9ng m\u1EDD \u1EA3o cho m\xE0u \u0111\xE3 ch\u1ECDn.</p><h3 id="vi-tri-9" tabindex="-1"><a class="header-anchor" href="#vi-tri-9" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>Tr\xEAn menu ch\xEDnh, ch\u1ECDn <strong>Layer</strong> &gt; <strong>New Fill Layer</strong>. T\u1EEB \u0111\xF3, b\u1EA1n c\xF3 c\xE1c t\xF9y ch\u1EC9nh &quot;Solid Color&quot;, &quot;Gradient&quot;, ho\u1EB7c &quot;Pattern&quot;.</p><p><img src="data:image/jpeg;base64," alt="V\u1ECB tr\xED Layer tr\xEAn Photoshop"></p><h3 id="\u0111o-mau" tabindex="-1"><a class="header-anchor" href="#\u0111o-mau" aria-hidden="true">#</a> \u0110\u1ED5 m\xE0u</h3><p>\u0110\u1EA7u ti\xEAn, ch\u1ECDn layer b\u1EA1n mu\u1ED1n \u0111\u1ED5 m\xE0u. Sau \u0111\xF3, t\u1EEB menu ch\xEDnh, ch\u1ECDn <strong>Layer</strong> &gt; <strong>New Fill Layer</strong> &gt; <strong>Solid Color</strong>... Ti\u1EBFp theo, c\u1EEDa s\u1ED5 New Layer s\u1EBD m\u1EDF ra, nh\u1EADp t\xEAn layer. \u0110\u1EEBng lo l\u1EAFng v\u1EC1 vi\u1EC7c l\u1EF1a ch\u1ECDn m\xE0u b\u1EA1n t\u1EA1i th\u1EDDi \u0111i\u1EC3m \u0111\xF3, b\u01B0\u1EDBc n\xE0y \u0111\u01A1n gi\u1EA3n ch\u1EC9 \u0111\u1EC3 \u0111\u1EB7t t\xEAn layer. Sau khi \u0111\u1EB7t t\xEAn xong ch\u1ECDn <strong>OK</strong>.</p><p><img src="data:image/jpeg;base64," alt="T\u1EA1o m\xE0u m\u1EDBi tr\xEAn Photoshop"></p><p>B\u01B0\u1EDBc ti\u1EBFp, c\u1EEDa s\u1ED5 Color Picker xu\u1EA5t hi\u1EC7n. T\u1EA1i \u0111\xE2y, b\u1EA1n c\xF3 th\u1EC3 ch\u1ECDn m\xE0u mu\u1ED1n \u0111\u1ED5. T\u1EEB \u0111\xF3, ch\u1ECDn layer n\u1EC1n \u0111\u1EC3 t\xF4 m\xE0u, m\xE0u l\u1EF1a ch\u1ECDn trong Color Picker m\u1EB7c \u0111\u1ECBnh l\xE0 m\xE0u xanh da tr\u1EDDi.</p><p><img src="data:image/jpeg;base64," alt="M\xE0u n\u1EC1n m\u1EB7c \u0111\u1ECBnh c\u1EE7a Photoshop"></p><h3 id="hoa-tiet-cho-anh" tabindex="-1"><a class="header-anchor" href="#hoa-tiet-cho-anh" aria-hidden="true">#</a> H\u1ECDa ti\u1EBFt cho \u1EA3nh</h3><p>B\u1EA1n c\u0169ng c\xF3 th\u1EC3 t\u1EF1 thi\u1EBFt k\u1EBF h\u1ECDa ti\u1EBFt n\u1EC1u c\xF3 th\u1EDDi gian v\xE0 \u0111am m\xEA ho\u1EB7c t\u1EA3i c\xE1c n\u1EC1n h\u1ECDa ti\u1EBFt mi\u1EC5n ph\xED c\xF3 s\u1EB5n tr\xEAn t\xECm ki\u1EBFm Google.</p><p>\u0110\u1EA7u ti\xEAn, ch\u1ECDn layer b\u1EA1n mu\u1ED1n \u0111\u1ED5 m\xE0u. Sau \u0111\xF3, t\u1EEB menu ch\xEDnh, ch\u1ECDn <strong>Layer</strong> &gt; <strong>New Fill Layer</strong> &gt; <strong>Pattern...</strong> Ti\u1EBFp theo, c\u1EEDa s\u1ED5 New Layer s\u1EBD m\u1EDF ra, nh\u1EADp t\xEAn layer. \u0110\u1EEBng lo l\u1EAFng v\u1EC1 vi\u1EC7c l\u1EF1a ch\u1ECDn m\xE0u b\u1EA1n t\u1EA1i th\u1EDDi \u0111i\u1EC3m \u0111\xF3, b\u01B0\u1EDBc n\xE0y \u0111\u01A1n gi\u1EA3n ch\u1EC9 \u0111\u1EC3 \u0111\u1EB7t t\xEAn layer. Sau khi \u0111\u1EB7t t\xEAn xong ch\u1ECDn <strong>OK</strong>.</p><p>B\u01B0\u1EDBc ti\u1EBFp, c\u1EEDa s\u1ED5 Pattern Fill xu\u1EA5t hi\u1EC7n. T\u1EA1i \u0111\xE2y, b\u1EA1n c\xF3 th\u1EC3 ch\u1ECDn h\u1ECDa ti\u1EBFt. T\u1EEB \u0111\xF3, ch\u1ECDn layer n\u1EC1n \u0111\u1EC3 t\xF4 m\xE0u, m\xE0u \u0111\u01B0\u1EE3c l\u1EF1a ch\u1ECDn s\u1EBD thay v\xE0o n\u1EC1n m\xE0u xanh.</p><p><img src="data:image/jpeg;base64," alt="Ch\xE8n h\u1ECDa ti\u1EBFt tr\xEAn Photoshop"></p><h3 id="su-dung-gradient-fill" tabindex="-1"><a class="header-anchor" href="#su-dung-gradient-fill" aria-hidden="true">#</a> S\u1EED d\u1EE5ng Gradient Fill</h3><p>\u0110\u1EA7u ti\xEAn, ch\u1ECDn layer b\u1EA1n mu\u1ED1n \u0111\u1ED5 m\xE0u. Sau \u0111\xF3, t\u1EEB menu ch\xEDnh, ch\u1ECDn <strong>Layer</strong> &gt; <strong>New Fill Layer</strong> &gt; <strong>Gradient...</strong> Ti\u1EBFp theo, c\u1EEDa s\u1ED5 New Layer s\u1EBD m\u1EDF ra, nh\u1EADp t\xEAn layer. \u0110\u1EEBng lo l\u1EAFng v\u1EC1 vi\u1EC7c l\u1EF1a ch\u1ECDn m\xE0u b\u1EA1n t\u1EA1i th\u1EDDi \u0111i\u1EC3m \u0111\xF3, b\u01B0\u1EDBc n\xE0y \u0111\u01A1n gi\u1EA3n ch\u1EC9 \u0111\u1EC3 \u0111\u1EB7t t\xEAn layer. Sau khi \u0111\u1EB7t t\xEAn xong ch\u1ECDn <strong>OK</strong>.</p><p>Ti\u1EBFp theo, c\u1EEDa s\u1ED5 &quot; Gradient Fill&quot; hi\u1EC7n ra. H\xE3y th\u1EED d\xF9ng c\xE1c t\u1EE7y ch\u1ECDn c\xF3 trong c\u1EEDa s\u1ED5. \u0110\u1EC3 ch\u1ECDn gradient kh\xE1c, k\xEDch chu\u1ED9t ph\u1EA3i v\xE0o gradient m\u1EB7c \u0111\u1ECBnh \u0111\u1EC3 m\u1EDF Gradient Editor, nh\u01B0 d\u01B0\u1EDBi \u0111\xE2y:</p><p><img src="data:image/jpeg;base64," alt="C\u1EEDa s\u1ED5 Gradient tr\xEAn Photoshop"></p><h2 id="_11-the-eyedropper" tabindex="-1"><a class="header-anchor" href="#_11-the-eyedropper" aria-hidden="true">#</a> 11. The Eyedropper</h2><h3 id="\u0111inh-nghia-10" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-10" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>C\xF4ng c\u1EE5 nh\u1ECF g\u1ECDn n\xE0y cho ph\xE9p tr\xEDch xu\u1EA5t ho\u1EB7c s\u1EED d\u1EE5ng m\xE0u b\u1EA5t k\u1EF3 t\u1EEB \u1EA3nh tr\xEAn Photoshop.</p><h3 id="vi-tri-10" tabindex="-1"><a class="header-anchor" href="#vi-tri-10" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>N\u1EB1m tr\xEAn thanh c\xF4ng c\u1EE5 b\xEAn tr\xE1i.</p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 Eyedropper"></p><h3 id="su-dung-eyedropper" tabindex="-1"><a class="header-anchor" href="#su-dung-eyedropper" aria-hidden="true">#</a> S\u1EED d\u1EE5ng Eyedropper</h3><p>Ch\u1ECDn bi\u1EC3u t\u01B0\u1EE3ng tr\xEAn thanh c\xF4ng c\u1EE5 b\xEAn. Ti\u1EBFp theo, x\xE1c \u0111\u1ECBnh m\xE0u mu\u1ED1n tr\xEDch, v\xE0 k\xEDch v\xE0o khu v\u1EF1c sao ch\xE9p.</p><p>Khi v\u1EEBa tr\xEDch m\xE0u, b\u1EA1n s\u1EBD th\u1EA5y n\xF3 bi\u1EC3u di\u1EC5n c\u1EA3 tr\xEAn m\xF4 \u0111un m\xE0u \u1EDF tr\xEAn c\xF9ng b\xEAn ph\u1EA3i c\u1EE7a m\xE0n h\xECnh v\xE0 thanh menu b\xEAn. B\u1EA1n c\xF3 th\u1EC3 k\xEDch \u0111\xFAp v\xE0o h\u1ED9p m\xE0u \u0111\u1EC3 m\u1EDF c\xF3 m\xE0u cao c\u1EA5p.</p><p><img src="data:image/jpeg;base64," alt="M\xE0u eyedropper tr\xEAn Photoshop"></p><h2 id="_12-blending-options" tabindex="-1"><a class="header-anchor" href="#_12-blending-options" aria-hidden="true">#</a> 12. Blending Options</h2><h3 id="\u0111inh-nghia-11" tabindex="-1"><a class="header-anchor" href="#\u0111inh-nghia-11" aria-hidden="true">#</a> \u0110\u1ECBnh ngh\u0129a</h3><p>T\xF9y ch\u1EC9nh Blending bao g\u1ED3m m\u1ED9t s\u1ED1 t\xEDnh n\u0103ng ch\u1EC9nh s\u1EEDa giao di\u1EC7n v\xE0 \u0111\u1ED3 h\u1ECDa. V\xED d\u1EE5, b\u1EA1n c\xF3 th\u1EC3 s\u1EED d\u1EE5ng hi\u1EC7u \u1EE9ng &quot;Outer Glow&quot; \u0111\u1EC3 ch\u1EEF hi\u1EC7n ra nh\u01B0 \u0111ang ph\xE1t s\xE1ng. Ho\u1EB7c, b\u1EA1n c\xF3 th\u1EC3 s\u1EED d\u1EE5ng hi\u1EC7u \u1EE9ng &quot;Drop Shadow&quot; \u0111\u1EC3 th\xEAm b\xF3ng cho ch\u1EEF. H\xE3y b\u1ECF ch\xFAt th\u1EDDi gian \u0111\u1EC3 kh\xE1m ph\xE1 nh\u1EEFng hi\u1EC7u \u1EE9ng layer v\xE0 t\xECm ra t\xEDnh n\u0103ng \u01B0a th\xEDch.</p><h3 id="vi-tri-11" tabindex="-1"><a class="header-anchor" href="#vi-tri-11" aria-hidden="true">#</a> V\u1ECB tr\xED</h3><p>T\u1EEB thanh c\xF4ng c\u1EE5 ch\xEDnh, ch\u1ECDn Layer &gt; Layer Style &gt; Blending Options... B\u1EA1n c\xF3 th\u1EC3 k\xEDch \u0111\xFAp v\xE0o b\u1EA5t c\u1EE9 layer n\xE0o \u0111\u1EC3 m\u1EDF t\xF9y ch\u1EC9nh cho layer c\u1EE5 th\u1EC3.</p><p><img src="data:image/jpeg;base64," alt="Ch\u1EC9nh s\u1EEDa tr\xEAn Photoshop"></p><h3 id="su-dung-blending-options" tabindex="-1"><a class="header-anchor" href="#su-dung-blending-options" aria-hidden="true">#</a> S\u1EED d\u1EE5ng Blending Options</h3><p>\u0110\u1EA7u ti\xEAn, ch\u1ECDn layer s\u1EED d\u1EE5ng cho blending. B\u01B0\u1EDBc ti\u1EBFp, m\u1EDF t\xF9y ch\u1EC9nh blending v\xE0 ch\u1ECDn \u0111\u1ED1i t\u01B0\u1EE3ng mu\u1ED1n s\u1EED d\u1EE5ng. V\u1EDBi c\xE1c t\xF9y ch\u1EC9nh c\xF3 s\u1EB5n, b\u1EA1n c\xF3 th\u1EC3 c\xF3 m\u1ED9t l\u01B0\u1EE3ng l\u1EDBn hi\u1EC7u \u1EE9ng \u0111\u1EC3 ho\xE0n thi\u1EC7n b\u1EE9c h\xECnh. C\xF3 nhi\u1EC1u \u0111i\u1EC1u th\xFA v\u1ECB \u1EDF t\u1EEBng layer, \u1EA3nh v\xE0 ch\u1EEF. Nh\xECn v\xE0o \u1EA3nh d\u01B0\u1EDBi:</p><p><img src="data:image/jpeg;base64," alt="T\u1EA1o h\xECnh tr\xEAn Photoshop"></p><p>V\xED d\u1EE5, ch\u1EC9nh s\u1EEDa layer ch\u1EEF v\xE0 ch\u1ECDn &quot;Bevel &amp; Emboss&quot;. Tr\xF4ng \u0111\u1EB9p ph\u1EA3i kh\xF4ng?</p><p><img src="data:image/jpeg;base64," alt="T\u1EA1o b\xF3ng ch\u1EEF tr\xEAn Photoshop"></p>',239),U=[V];function q(K,p){return a(),t("div",null,U)}var i=A(o,[["render",q],["__file","section2.html.vue"]]);export{i as default};
